import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const Detail = (props) => {
  const id = useParams().id;
  const [book, setBook] = useState();

  useEffect(() => {
    fetch('http://localhost:8080/book/{id}', { method: 'GET' })
      .then((res) => res.json())
      .then((res) => {
        console.log(1, res);
        // setBooks(res);
      })
      .catch((err) => alert(err));
  }, []);

  return (
    <div>
      <h1>책 상세보기</h1>
    </div>
  );
};

export default Detail;
